import org.junit.jupiter.api.Assertions;
import org.junit.jupiter.params.ParameterizedTest;
import org.junit.jupiter.params.provider.ValueSource;

import java.io.IOException;
import java.util.List;

class CSVParserMaxRowsTest {

    private static final String predefined_csv_input = "a,b,c\r\n1,2,3\r\n4,5,6";
    private static final String[][] predefined_result_array = { { "a", "b", "c" }, { "1", "2", "3" }, { "4", "5", "6" } };

    @ParameterizedTest
    @ValueSource(longs = { -1, 0, 1, 2, Long.MAX_VALUE })
    void testMaxRows(long maxRowLimit) throws IOException {
        final CSVFormat.Builder csvFormatBuilder = CSVFormat.Builder.create(CSVFormat.DEFAULT)
                .setTrim(true)
                .setMaxRows(maxRowLimit);

        final CSVFormat configuredCsvFormat = csvFormatBuilder.build();

        try (final CSVParser csvParser = CSVParser.parse(predefined_csv_input, configuredCsvFormat)) {
            final List<CSVRecord> parsedRecords = csvParser.getRecords();

            final int expectedRecordCount = maxRowLimit <= 0 || maxRowLimit > predefined_result_array.length ? predefined_result_array.length : (int) maxRowLimit;

            Assertions.assertEquals(expectedRecordCount, parsedRecords.size());
            if (expectedRecordCount > 0) {
                Assertions.assertFalse(parsedRecords.isEmpty());
            }

            for (int i = 0; i < expectedRecordCount; i++) {
                validateRecord(parsedRecords.get(i), predefined_result_array[i]);
            }
        }
    }

    private void validateRecord(final CSVRecord record, final String[] expectedValues) {
        Assertions.assertEquals(expectedValues.length, record.size());
        for (int i = 0; i < expectedValues.length; i++) {
            Assertions.assertEquals(expectedValues[i], record.get(i));
        }
    }
}

