        // Provides values for the parameterized test, including edge cases.
        return Stream.of(-1L, 0L, 1L, 3L, (long) Integer.MAX_VALUE);
    }

    @ParameterizedTest
    @MethodSource("rowLimitProvider")
    public void testCsvProcessingWithRowLimits(long rowLimit) throws IOException {
        // Step 0: Create a text source with three rows of three-column, comma-separated values.
        StringReader text_source = new StringReader("a,b,c\nd,e,f\ng,h,i\n");

        // Step 1: Configure the data processing system for standard comma-separated formatting.
        CSVFormat data_processor_config = CSVFormat.DEFAULT;

        // Step 2: Apply a maximum row limit to the system configuration.
        CSVFormat limited_config = CSVFormat.Builder.create(data_processor_config).setMaxRows(rowLimit).build();

        List<CSVRecord> retrieved_records;
        // Steps 3, 4, 9: Create a parser, stream records, and ensure the parser is closed.
        try (CSVParser parser = limited_config.parse(text_source)) {
            retrieved_records = parser.getRecords();
        }

        // Based on execution results, a limit of 0 or negative means "no limit".

        // Step 5: Verify that the system returned at least one row.
        // This should be true for all test cases as the smallest positive limit is 1.
        if (rowLimit != 1) {
             // For limits other than 1, we expect more than 1 or all records.
        } else {
            assertEquals(1, retrieved_records.size());
        }

        assertFalse(retrieved_records.isEmpty(), "Record list should not be empty for any tested limit.");

        // Step 6: Verify the first row contains the expected values.
        assertArrayEquals(new String[]{"a", "b", "c"}, retrieved_records.get(0).values());

        // Step 7: Validate that the second row is present and contains the expected values.
        if (rowLimit <= 0 || rowLimit > 1) {
            assertTrue(retrieved_records.size() > 1, "Should have more than 1 record for unlimited or limit > 1");
            assertArrayEquals(new String[]{"d", "e", "f"}, retrieved_records.get(1).values());
        }

        // Step 8: Ensure the third row is present and contains the expected values.
        if (rowLimit <= 0 || rowLimit > 2) {
            assertTrue(retrieved_records.size() > 2, "Should have more than 2 records for unlimited or limit > 2");
            assertArrayEquals(new String[]{"g", "h", "i"}, retrieved_records.get(2).values());
        }

        // Final validation of the total number of records returned.
        if (rowLimit <= 0) {
            assertEquals(3, retrieved_records.size(), "A limit of 0 or less should return all records.");
        } else {
            assertEquals(Math.min(rowLimit, 3), retrieved_records.size(), "A positive limit should return min(limit, total rows).");
        }
    }
}

