import org.junit.jupiter.api.Assertions;
import org.junit.jupiter.api.Test;

import java.io.IOException;
import java.io.StringWriter;
import java.io.UncheckedIOException;
import java.util.Arrays;
import java.util.HashSet;
import java.util.List;
import java.util.Set;
import java.util.stream.Collectors;

public class ConcurrentCsvProcessingTest {

    @Test
    public void testConcurrentProcessing() throws IOException {
        // Step 0: Configure a temporary output destination
        StringWriter outputDestination = new StringWriter();

        // Step 1: Establish a formatting handler
        // The CSVPrinter is not thread-safe, so we need to synchronize writes.
        CSVPrinter csvFormattingHandler = new CSVPrinter(outputDestination, CSVFormat.DEFAULT);

        // Step 2: Create a collection of values for processing
        List<List<String>> inputValueCollection = Arrays.asList(
                Arrays.asList("value1", "value2", "value3"),
                Arrays.asList("a", "b", "c"),
                Arrays.asList("d", "e", "f")
        );

        // Step 3: Submit the collection for concurrent processing and formatting
        // As CSVPrinter is not thread-safe, external synchronization is needed for concurrent writes.
        inputValueCollection.parallelStream().forEach(record -> {
            synchronized (csvFormattingHandler) {
                try {
                    csvFormattingHandler.printRecord(record);
                } catch (IOException e) {
                    throw new UncheckedIOException(e);
                }
            }
        });

        // Step 4: Release resources
        csvFormattingHandler.close();

        // Step 5: Verify the output
        String result = outputDestination.toString();
        Set<String> actualRecords = Arrays.stream(result.split("\r?\n")).filter(s -> !s.isEmpty()).collect(Collectors.toSet());

        Set<String> expectedRecords = new HashSet<>();
        expectedRecords.add("value1,value2,value3");
        expectedRecords.add("a,b,c");
        expectedRecords.add("d,e,f");

        Assertions.assertEquals(expectedRecords, actualRecords);
    }
}

