import org.junit.jupiter.api.Assertions;
import org.junit.jupiter.params.ParameterizedTest;
import org.junit.jupiter.params.provider.EnumSource;

class TokenToStringTest {

    @ParameterizedTest
    @EnumSource(Token.Type.class)
    void testToString(final Token.Type tokenType) {
        final String invalidTypeName = Token.Type.INVALID.name();
        final Token token = new Token();

        final String initialStringRepresentation = token.toString();
        Assertions.assertTrue(initialStringRepresentation.contains(invalidTypeName));

        token.reset();
        final String resetStringRepresentation = token.toString();
        Assertions.assertTrue(resetStringRepresentation.contains(invalidTypeName));

        token.type = null;
        final String nullTypeStringRepresentation = token.toString();
        Assertions.assertFalse(nullTypeStringRepresentation.isEmpty());

        token.reset();
        final String parameterizedTypeName = tokenType.name();
        token.type = tokenType;
        final String assignedTypeStringRepresentation = token.toString();
        Assertions.assertTrue(assignedTypeStringRepresentation.contains(parameterizedTypeName));

        token.content.setLength(1000);
        final String largeContentStringRepresentation = token.toString();
        Assertions.assertTrue(largeContentStringRepresentation.contains(parameterizedTypeName));
    }
}

